public static Aliases load(byte[] bytes) {
  if (bytes == null || bytes.length == 0) {
    return new Aliases();
  }
  Map<String,Map<String,String>> aliasMap = (Map<String,Map<String,String>>) ZkStateReader.fromJSON(bytes);

  return new Aliases(aliasMap);
}

